import React from "react";
import styles from './summary.module.css';

const Summary = () => {
    return (
        <Section className={styles.summary}>
            <h2>Need Pesticides, Go to Krushi Sarathi</h2>
            <p>Your Agro Store-Krushi Sarathi!!</p>
            <p>Free Consulting, Free Home Delivery, Delivering Trust!! </p>
        </Section>
    )
}

export default Summary;
